import React from 'react';
import {useAuth0} from '@auth0/auth0-react';
import JSONPRETTY from 'react-json-pretty';
import JSONPretty from 'react-json-pretty';



const Profile = () => {
    const {user} = useAuth0();
    return (
        <div>
            <h2>{user.name}</h2>
            <p>{user.email}</p>
            <JSONPretty data={user}/>
           {/* {JSON.stringify(user,null,2)}  */}
        </div>
    )
}

export default Profile
